import React from "react";

export default function Images(props) {
    return (
      <div className="previewMeme">
        {props.memeUrl && (
          <img
            src={props.memeUrl}
            alt={props.chosenMeme === '' ? '' : 'A meme of ' + props.chosenMeme}
          />
        )}
      </div>
    );
  }
